import React, {Component} from "react";

class PinForm extends Component {
    constructor(props){
        super(props);
        this.state = {
            pin: {
                name: "",
                categoryType: "",
                lat: 0.0,
                lng: 0.0,
                notes: "",
                user: "",
                id: 0
            }
        }
    }
}

export default PinForm;
